import Link from 'next/link'
import Layout from '../Layout/Layout';
class Home extends React.Component{
    render(){
        return(
            <Layout>
                <div className="content">
                    <div className="welcome_desc">
                        
                    </div>
                </div>
                <Link href="/about"><a>Quay lại</a></Link>
                <h1>Đây là trang chủ</h1>
            </Layout>
        );
    }
}
export default Home;
